(() => {
  if ("block" === window.ebox_builder_metaboxes.editor)
    wp.data.subscribe(() => {
      const e = [
          "meta-box-ebox-course-access-settings",
          "meta-box-ebox-course-display-content-settings",
          "meta-box-ebox-course-navigation-settings",
          "meta-box-ebox_course_builder",
          "meta-box-ebox_course_teams",
          "meta-box-ebox_quiz_builder",
          "meta-box-ebox-course-modules",
          "meta-box-ebox-course-quizzes",
          "meta-box-ebox-course-topics",
          "meta-box-ebox-quiz",
        ],
        s = wp.data.select("core/edit-post").getPreference("panels");
      for (const o in s)
        if (s.hasOwnProperty(o) && e.includes(o)) {
          const e = s[o];
          e.hasOwnProperty("enabled") &&
            (e.enabled ||
              wp.data.dispatch("core/edit-post").toggleEditorPanelEnabled(o));
        }
    });
  else {
    const e = [
      "ebox-course-access-settings",
      "ebox-course-display-content-settings",
      "ebox-course-navigation-settings",
      "ebox_course_builder",
      "ebox_course_teams",
      "ebox_quiz_builder",
      "ebox-course-modules",
      "ebox-course-quizzes",
      "ebox-course-topics",
      "ebox-quiz",
    ];
    jQuery(".hide-postbox-tog").on("click.postboxes", function (s) {
      const o = jQuery(this),
        a = o.val(),
        t = jQuery("#" + a);
      -1 < e.indexOf(a) &&
        (o.prop("checked") ||
          (s.preventDefault(), t.show(), o.prop("checked", !0)));
    });
  }
})();
